import React, { useEffect, useState } from "react";

interface VisitorPassProps {
  // full API URL for the gate_pass.json. If not provided, the defaultURL below is used.
  apiUrl?: string;
  // optional simple pass id to append to a known base (not used by default)
  passId?: string;
}

type ApiDocument = { id: number; document_url: string };
type ApiAsset = {
  id: number;
  asset_category_name?: string;
  asset_name?: string;
  serial_model_number?: string;
  notes?: string;
  documents?: ApiDocument[];
};

type VisitorIdentity = {
  id: number;
  identity_type?: string;
  government_id_number?: string;
  documents?: ApiDocument[];
};

type AdditionalVisitor = {
  id: number;
  name?: string;
  mobile?: string;
  email?: string;
  vehicle_type?: string;
  vehicle_number?: string;
  parking_slot_number?: string;
  identity?: VisitorIdentity;
  assets?: ApiAsset[];
};

type ApiResponse = Partial<{
  id: number;
  guest_name: string;
  visit_purpose: string;
  guest_number: string;
  guest_vehicle_number: string;
  expected_at: string;
  pass_start_date: string;
  pass_end_date: string;
  otp_string: string;
  qr_code_url: string;
  vstatus: string;
  guest_type: string;
  plus_person: number;
  assets: ApiAsset[];
  additional_visitors: AdditionalVisitor[];
  visitor_identity: VisitorIdentity;
  notes: string;
  visit_to: string;
  visit_to_number: string;
  created_at: string;
  image: string;
  pass_number: string | null;
  email: string | null;
  visitor_host_name: string | null;
  guest_from: string | null;
  guest_email: string | null;
  visitor_consent_form?: { value?: string; description?: string };
  // optional alternate host name fields that some APIs provide
  person_to_meet_name?: string | null;
  visited_to_host_name?: string | null;
}>;

// derive token from query param visitor_code or from URL path when possible
function extractToken(): string | null {
  if (typeof window === "undefined") return null;
  // prefer query param ?visitor_code=...
  try {
    const qp = new URLSearchParams(window.location.search);
    const code = qp.get("visitor_code") || qp.get("visitorCode") || qp.get("token");
    if (code) return code;
  } catch {
    // ignore
  }
  const parts = window.location.pathname.split("/").filter(Boolean);
  // If path contains 'gatepass' take the following segment as token
  const gateIdx = parts.findIndex((p) => p.toLowerCase() === "gatepass");
  if (gateIdx >= 0 && parts.length > gateIdx + 1) return parts[gateIdx + 1];
  // fallback: last segment
  return parts.length ? parts[parts.length - 1] : null;
}

// Use static live base URL but prefer token from current URL when present
const DEFAULT_API = (() => {
  const base = "https://live-api.gophygital.work";
  const fallback = "";
  const id = extractToken() ?? fallback;
  return `${base}/pms/visitors/${id}/gate_pass.json`;
})();

const VisitorPassWeb: React.FC<VisitorPassProps> = ({
  apiUrl = DEFAULT_API,
}) => {
  const [data, setData] = useState<ApiResponse | null>(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState<string | null>(null);
  const [consentExpanded, setConsentExpanded] = useState(false);

  useEffect(() => {
    const controller = new AbortController();
    const fetchData = async () => {
      // apiUrl is always provided via DEFAULT_API unless overridden
      setLoading(true);
      setError(null);
      try {
        const res = await fetch(apiUrl, { signal: controller.signal });
        if (!res.ok) throw new Error(`HTTP ${res.status}`);
        const json = await res.json();
        // API appears to wrap the object under a key; try to locate main object
        // If response is { object: { ... } } or array, handle gracefully
        let payload: unknown = json;
        const isRecord = (v: unknown): v is Record<string, unknown> =>
          v !== null && typeof v === "object";
        if (isRecord(json)) {
          // many backends wrap under data or object. prefer properties we expect
          if (isRecord((json as Record<string, unknown>).object))
            payload = (json as Record<string, unknown>).object;
          else if (isRecord((json as Record<string, unknown>).data))
            payload = (json as Record<string, unknown>).data;
        }
        // perform a runtime shape check (best-effort)
        if (isRecord(payload)) setData(payload as ApiResponse);
      } catch (err) {
        const e = err as { name?: string; message?: string };
        // avoid treating AbortError as a real error
        if (e.name !== "AbortError") setError(e.message ?? "Failed to fetch");
      } finally {
        setLoading(false);
      }
    };

    fetchData();
    return () => controller.abort();
  }, [apiUrl]);

  // render helpers
  const formatDate = (d?: string) => {
    if (!d) return "-";
    try {
      const dt = new Date(d);
      // Show only the calendar date, not the time
      return dt.toLocaleDateString();
    } catch {
      return d;
    }
  };

  const joinAssets = (assets?: ApiAsset[]) => {
    if (!assets || assets.length === 0) return "-";
    return assets
      .map((a) => a.asset_name || a.asset_category_name || "")
      .filter(Boolean)
      .join(", ");
  };

  // fallbacks to preserve existing UI before data loads
  const name = data?.guest_name ?? "null";
  const role = data?.guest_type ?? "null";
  const otp = data?.otp_string ?? "null";
  const host =
    data?.person_to_meet_name ?? data?.visited_to_host_name ?? data?.visitor_host_name ?? "null";
  const passId = data?.pass_number ? String(data.id) : "null";
  const visitDate = data?.expected_at
    ? formatDate(data.expected_at)
    : (data?.pass_start_date ?? "null");
  const timeSlot = data?.expected_at
    ? new Date(data.expected_at).toLocaleTimeString()
    : "null";
  const email = data?.guest_email ?? "null"; // guest_number often contains mobile; keep as a fallback
  const purpose = data?.visit_purpose ?? "null";
  const assets = joinAssets(data?.assets) ?? "null";
  const additionalVisitors = data?.plus_person ?? 0;
  const location = data?.guest_from ?? "null";
  const room = data?.guest_number ?? "null";
  const status = data?.vstatus ?? "null";
  const qrCodeUrl =
    data?.qr_code_url ??
    `https://api.qrserver.com/v1/create-qr-code/?size=300x300&data=${encodeURIComponent(`${passId}|${otp}`)}&color=ffffff&bgcolor=C72030`;

  // Prefer consent HTML from API; no local fallback
  const apiConsentHtml = data?.visitor_consent_form?.description ?? null;
  const stripTags = (html: string) =>
    html
      .replace(/<[^>]*>/g, " ")
      .replace(/\s+/g, " ")
      .trim();
  const consentText = apiConsentHtml ? stripTags(apiConsentHtml) : "-";
  const consentWords = consentText.split(/\s+/);
  const shouldTruncateConsent = consentWords.length > 14;
  const shortConsent = shouldTruncateConsent
    ? consentWords.slice(0, 14).join(" ") + "..."
    : consentText;

  return (
    <div className="min-h-screen bg-gray-50 flex items-start justify-center pt-4 pb-0 px-4 sm:px-6">
      <div className="w-full max-w-xs sm:max-w-sm">
        {/* Ticket header */}
        <div className="relative overflow-hidden rounded-t-md">
          <div className="bg-[#C72030] text-white px-5 py-4 rounded-t-md relative overflow-hidden">
            <div className="flex items-start justify-between">
              <div className="flex-1 flex flex-col items-start gap-2 min-w-0">
                {/* small brand/logo on the top-left */}
                <div className="flex flex-col items-start">
                  <div className="w-12 h-12 flex items-center justify-center">
                    <img
                      src={`data:image/png;base64,`}
                      alt="Company Logo"
                      className="h-5 object-contain"
                    />
                  </div>
                </div>

                <div>
                  <div className="text-xs opacity-90">OTP:</div>
                  <div className="mt-1 text-2xl font-semibold tracking-wider">
                    {otp.split("").join(" ")}
                  </div>
                  <div className="text-[11px] mt-1 whitespace-normal sm:whitespace-nowrap">
                    Note : Show this QR code or OTP to the guard at the
                    entrance.
                  </div>
                </div>
              </div>

              <div className="ml-3 flex-shrink-0">
                <div className="w-28 h-28 bg-transparent rounded-sm flex items-center justify-center overflow-hidden">
                  {/* QR image from API (falls back to generated if missing) */}
                  <img
                    src={qrCodeUrl}
                    alt="QR code"
                    className="w-28 h-28 object-cover"
                  />
                </div>
              </div>
            </div>
          </div>

          {/* perforation line with semicircles */}
          <div className="relative bg-white">
            <div className="h-3 bg-white -mt-0.5 flex items-center justify-between">
              <div className="w-6 h-6 bg-white rounded-full -ml-3 border-t border-b border-l border-white" />
              <div className="w-6 h-6 bg-white rounded-full -mr-3 border-t border-b border-r border-white" />
            </div>
            <div className="border-t border-dashed border-gray-200" />
          </div>
        </div>

        {/* Details card */}
        <div className="bg-[#F6F4EE] border border-gray-200 rounded-b-md py-2 px-3">
          <div className="flex items-center gap-2">
            <div className="w-16 h-16 rounded-full bg-[#f1f3f4] flex items-center justify-center p-1 overflow-hidden">
              {data?.image ? (
                <img
                  src={data.image}
                  alt="Visitor avatar"
                  className="w-full h-full object-cover"
                  onError={(e) => {
                    // fallback to placeholder look if image fails to load
                    const target = e.currentTarget as HTMLImageElement;
                    target.style.display = "none";
                  }}
                />
              ) : (
                <svg
                  width="36"
                  height="36"
                  viewBox="0 0 64 64"
                  xmlns="http://www.w3.org/2000/svg"
                  aria-hidden
                >
                  <circle cx="32" cy="20" r="12" fill="#d1d5db" />
                  <path
                    d="M12 54c0-11 10-18 20-18s20 7 20 18v2H12v-2z"
                    fill="#e5e7eb"
                  />
                </svg>
              )}
            </div>
            <div className="flex-1">
              <div className="flex items-center justify-between">
                <div>
                  <div className="text-base font-semibold text-[#111827]">
                    {name}
                  </div>
                  <div className="text-sm text-gray-600">{"Visitor"}</div>
                </div>
                <div
                  className={`text-sm font-semibold ${status === "Approved" ? "text-green-600" : status === "Pending" ? "text-yellow-600" : "text-[#C72030]"}`}
                >
                  {status}
                </div>
              </div>
            </div>
          </div>

          <div className="grid grid-cols-2 gap-2 mt-3 text-sm text-gray-700">
            {/* Row 1: Host Name (left) / Visitor Pass ID (right) */}
            <div className="min-w-0">
              <div className="text-xs text-gray-500">Host Name:</div>
              <div className="font-medium text-[12px]">{host}</div>
            </div>

            <div className="pl-10">
              <div className="text-xs text-gray-500">Visitor Pass ID:</div>
              <div className="font-medium text-[12px]">{passId}</div>
            </div>

            {/* Row 2: Visitor Number (left) / Purpose (right) */}
            <div>
              <div className="text-xs text-gray-500">Visitor Number:</div>
              <div className="font-medium text-[12px]">{room}</div>
            </div>

            <div className="pl-10">
              <div className="text-xs text-gray-500">Purpose:</div>
              <div className="font-medium text-[12px]">{purpose}</div>
            </div>

            {/* Row 3: Visit Date / Expected Time */}
            <div>
              <div className="text-xs text-gray-500">Visit Date:</div>
              <div className="font-medium text-[12px]">{visitDate}</div>
            </div>

            <div className="pl-10">
              <div className="text-xs text-gray-500">Expected Time:</div>
              <div className="font-medium text-[12px]">{timeSlot}</div>
            </div>

            {/* Row 4: Visitor Email ID / Additional Visitor */}
            <div>
              <div className="text-xs text-gray-500">Visitor Email ID:</div>
              <div className="font-medium text-[12px] break-words whitespace-normal">
                {email}
              </div>
            </div>

            <div className="pl-10">
              <div className="text-xs text-gray-500">Additional Visitor:</div>
              <div className="font-medium text-[12px]">
                {additionalVisitors}
              </div>
            </div>

            {/* Row 5: Coming From / To */}
            <div>
              <div className="text-xs text-gray-500">Coming From:</div>
              <div className="font-medium text-[12px]">{location}</div>
            </div>

            <div className="pl-10">
              <div className="text-xs text-gray-500">To:</div>
              <div className="font-medium text-[12px]">
                {data?.visit_to ?? "-"}
              </div>
            </div>

            {/* Row 6: Assets carried on the left */}
            <div className="col-span-2 sm:col-span-1">
              <div className="text-xs text-gray-500">Assets carried:</div>
              <div className="font-medium text-[12px]">{assets}</div>
            </div>
            <div />
          </div>
          <div className="mt-3 rounded text-[12px] text-[#C72030]">
            Important: Please present this pass along with a valid government ID
            at the security desk.
          </div>
        </div>

        {/* Consent box */}
        <div className="mt-2 border border-gray-200 bg-white  p-2">
          <div className="flex items-center justify-between mb-1">
            <div className="text-[13px] font-semibold leading-tight">
              Consent - Visitor Agreement
            </div>
            <button
              onClick={() => setConsentExpanded((s) => !s)}
              className="text-[12px] text-[#C72030] bg-white border border-[#efe9e9] px-2 py-1 rounded"
            >
              {consentExpanded ? "View less " : "View more "}
            </button>
          </div>
          <div className="text-[12px] text-gray-700">
            {consentExpanded ? (
              apiConsentHtml ? (
                <div
                  className="
          max-w-none
          leading-snug
          [&_p]:my-0
          [&_h1]:my-1
          [&_h1]:pl-4
          [&_h2]:my-1
          [&_ul]:my-1
          [&_li]:my-0
          [&_p]:leading-snug
          [&_li]:leading-snug
        "
                  dangerouslySetInnerHTML={{ __html: apiConsentHtml }}
                />
              ) : (
                "-"
              )
            ) : (
              <div className="whitespace-pre-line">{shortConsent}</div>
            )}
          </div>
        </div>

        {/* Powered by logo (inside the same wrapper, centered) */}
        <div className="mt-3 w-full flex items-center justify-center">
          <div className="flex items-center gap-3">
            <span className="text-gray-500 text-[12px]">Powered by:</span>
            <img
              src={`data:image/png;base64,`}
              alt="goPhygital logo"
              className="h-5 object-contain"
            />
          </div>
        </div>
      </div>
    </div>
  );
};

export default VisitorPassWeb;
